import { AppBar, Toolbar, Typography } from "@mui/material";
import React from "react";
import Icons from "../Icons/icons";

function NavBar() {
  return (
    <AppBar
      position="static"
      sx={{
        background: "#ffffff",
      }}
    >
      <Toolbar
        variant="dense"
        sx={{
          background: "#ffffff",
        }}
      >
        <Icons.Logo />
      </Toolbar>
    </AppBar>
  );
}

export default NavBar;
